	('node', 'email_configuration', 0, 18, 18, 'und', 0, '<html>\r\n    <body style="margin: 10; font-family:\'Museo 300\', \'san-serif\', Arial, Myriad pro; font-style: normal; font-size: 12px;">\r\n        <div style="width:650px;">\r\n            <img src=" MAIL_TEMPLATE_LOGO" alt="Club Mahindra"  title="Club Mahindra Holidays" />\r\n            <hr style="height:6px; color:#c0c0c0; background-color:#c0c0c0; border:none;"/>\r\n            <div>\r\n                <p>Hi, A user has registered to become a DSA Admin.Below are the user details</p> <br/>\r\n                Title: dsatitle<br/>\r\n                First Name: dsafirstname <br/>\r\n                Last Name: dsalastameEmail <br/>\r\n                ID: dsaemailid <br/>\r\n                Date of Birth: dsadateofbirth <br/>\r\n                Current Business: dsacurrent_business <br/>\r\n                Mailing Address: dsamailing_address <br/>\r\n                State: dsastate <br/>\r\n                City: dsacity <br/>\r\n                Zipe Code: dsazipcode <br/>\r\n                Telephone:dsacountrycode - dsaareacode - dsatelephone <br/>\r\n                Mobile Number: dsamobilenumber<br/><br />\r\n                <div style="font-size: 11px; color:#808080;">This email was intended for Admin. <a href="SITE_EMAIL_SECURITY_URL">Why have we added your details in this email</a>. <br/>&copy; Mahindra Holidays and Resorts India Ltd.</div>\r\n            </div>\r\n            <hr style="height:6px; color:#c0c0c0; background-color:#c0c0c0; border:none;"/>\r\n        </div>\r\n    </body>\r\n</html>', '', 'full_html'),
