	('node', 'page', 0, 33, 33, 'und', 0, '<h2 class="marginTop50">Extra Degree Club Details</h2>\r\n\r\n<p>The Extra Degree Program is a loyalty and rewards program launched only for our valued Business Partners. This program rewards and provides benefits to our Business Partners both on a quarterly and annual basis.</p>\r\n\r\n<p>Every quarter qualifiers for our various clubs – Purple Club, Red Club, White Club and Blue Club are announced. Based on the club qualified for Business partners are eligible for multiple benefits, but not limited to</p>\r\n\r\n<ul class="extraDegreeUl">\r\n	<li>Enhanced Training &amp; Support to develop Partner’s teams</li>\r\n	<li>Improved Sales Tools for better prospecting and customer acquisitions</li>\r\n	<li>Magical Resort Experiences &amp; International Trips</li>\r\n	<li>Recognition Platforms for you and your team</li>\r\n	<li>Marketing Support</li>\r\n	<li>Special Annual Privileges including renovation of partner office space</li>\r\n	<li>Special invites to our Annual Sales Conference</li>\r\n</ul>\r\n\r\n<p><a class="readMore" href="sites/default/files/The_Extra_Degree_Launch_0.pdf" target="_blank" title=""><span><img alt="" border="" src="sites/all/themes/cmh_orange_theme/images/icon_pdf_small.png" title="" /></span><span>Extra Degree Launch</span> </a></p>\r\n\r\n<p>&nbsp;</p>\r\n', '', 'full_html'),
	('node', 'page', 0, 34, 34, 'und', 0, '<h2>History</h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>This is not applicable as this is the 1<sup>st</sup> quarter we are getting this results.</p>\r\n<p>&nbsp;</p>', '', 'full_html'),
	('node', 'email_configuration', 0, 39, 39, 'und', 0, '<div><img alt="Club Mahindra" src="MAIL_TEMPLATE_LOGO" title="Club Mahindra Holidays" />\r\n<hr />\r\n<div>\r\n<h3>Hi,</h3>\r\nMy Account Details are as below,<br />\r\n\r\n<br />\r\n<br />\r\nRegards,<br />\r\nTeam Club Mahindra<br />\r\n&nbsp;\r\n<div>This email was intended for Admin <a href="SITE_EMAIL_SECURITY_URL">Why have we added your details in this email</a>.<br />\r\n© Mahindra Holidays and Resorts India Ltd.</div>\r\n</div>\r\n\r\n<hr /></div>', '', 'full_html');
