INSERT INTO `field_revision_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
	('node', 'email_configuration', 0, 4, 4, 'und', 0, '<html>\r\n    <body style="margin: 10; font-family:\'Museo 300\', \'san-serif\', Arial, Myriad pro; font-style: normal; font-size: 12px;">\r\n        <div style="width:650px;">\r\n            <img src=" MAIL_TEMPLATE_LOGO" alt="Club Mahindra"  title="Club Mahindra Holidays" />\r\n            <hr style="height:6px; color:#c0c0c0; background-color:#c0c0c0; border:none;"/>\r\n            <div>\r\n                <h3>Hi FIRSTNAME LASTNAME,</h3>\r\n                <p>Welcome! We are in receipt of your request to become a Club Mahindra business associate. We will reach out to you within 48 hours to start the formalities.<br />For any further queries, please call us at 39880000.</p>\r\n                Regards,<br />Team Club Mahindra <br /><br />\r\n                <div style="font-size: 11px; color:#808080;">\r\n                    This email was intended for  FIRSTNAME LASTNAME. <a href="SITE_EMAIL_SECURITY_URL">Why have we added your details in this email</a>. <br/>&copy; Mahindra Holidays and Resorts India Ltd.\r\n                </div>\r\n            </div>\r\n            <hr style="height:6px; color:#c0c0c0; background-color:#c0c0c0; border:none;"/>\r\n        </div>\r\n    </body>\r\n</html>', '', 'full_html'),
	('node', 'dsa_registration_page', 0, 5, 5, 'und', 0, '<p>Here is why...</p>\r\n\r\n<ul>\r\n	<li>With 147,000 happy member families, we\'ve changed the way India holidays!</li>\r\n	<li>40 exquisite resorts at some of the most picturesque locales in India and abroad</li>\r\n	<li>Club Mahindra, our flagship brand has witnessed a 29% CAGR over the last 8 years</li>\r\n	<li>We are India\'s No. 1 Holiday Company and among the top 10 vacation ownership companies in the world</li>\r\n	<li>...and a part of the US$ 15.4 billion Mahindra conglomerate that is a symbol of trust and ethical growth</li>\r\n</ul>\r\n', '', 'full_html'),
	('node', 'dsa_registration_page', 0, 6, 6, 'und', 0, '<ul>\r\n	<li>- A centrally-located office</li>\r\n	<li>- Positive Brand equity in market</li>\r\n	<li>- A Flair for managing a Direct Sales team, and</li>\r\n	<li>- An Experience in handling high net worth individuals</li>\r\n	<li>- ..And most importantly, your time!</li>\r\n</ul>\r\n', '', 'filtered_html'),
	('node', 'page', 0, 7, 7, 'und', 0, '<script>\r\njQuery(document).ready(function(){ \r\n  jQuery("#close_id").live(\'click\',function(){\r\n     var win = window.open("about:blank","_self");\r\n     win.close();\r\n   });\r\n});\r\n</script>\r\n<div class="resortAboutUs">\r\n        <div>\r\n           <div class="headLine">DSA Registration</div>\r\n            <div class="referFriendContent">\r\n                <div class="referDetailsTY">\r\n                    <div class="shareText bold">Thank you for registration as DSA!!!</div>\r\n                    <div class="bold">Your details have been successfully captured.</div>\r\n                    <div class="bold">We will reach out to you within 48 hours to start the formalities.</div>\r\n                    <div class="frmGrayButton"><a id="close_id" class="reset clearfix" title="Close" href="javascript:void(0);"><span class="left">&nbsp;</span><span class="middle">Close</span><span class="right">&nbsp;</span></a></div>\r\n                </div>\r\n            </div>          \r\n        </div>\r\n    </div>\r\n</div>', '', 'php_code'),
	('node', 'system_configuration', 0, 11, 11, 'und', 0, 'http://qacmh.mhril.in/CMH2.0Service/Service.svc?wsdl', '', 'plain_text'),
